import React, { useState } from 'react'
import { v4 as uuidv4 } from 'uuid'
import SlideShow from './SlideShow'
import './index.css'
export default function Home() {
  // Hook
  const [lists, setLists] = useState([
    { id: uuidv4(), url: require('../../assets/img/1.jpg'), title: '手机' },
    { id: uuidv4(), url: require('../../assets/img/1.jpg'), title: '家电' },
    { id: uuidv4(), url: require('../../assets/img/1.jpg'), title: '男装' },
    { id: uuidv4(), url: require('../../assets/img/1.jpg'), title: '女装' },
    { id: uuidv4(), url: require('../../assets/img/1.jpg'), title: '生活' },
  ])
  return (
    <div>
      <h1>首页</h1>
      {/* 顶部导航 */}
      <ul className='header-nav'>
        {
          lists.map(item => {
            return (
              <li key={item.id} className='home-list'>
                <img src={item.url} alt="" />
                <p>{item.title}</p>
              </li>
            )
          })
        }
      </ul>
      <SlideShow />
    </div>
  )
}
